(2, 'page_text_vertex_1560197104', '_vertex_1560197104', 'arabic', 'إفاد هي منصة إلكترونية لتقدم نموذج بديل للنماذج التقليدية الموجودة في الوقت الحالي للحصول على سيارة. لذلك تقدم إفاد لعملائها خدمة الاشتراك للسيارات والتي من خلالها تستطيع/ي استخدام سيارتك مقابل رسوم اشتراك ثابتة لمدة (أسبوع/ شهر/ سنة). تغطي رسوم الاشتراك خدمة التأمين الشامل وخدمة المساعدة على الطريق وخدمة الصيانة الدورية وخدمة التوصيل والاستلام وخدمة الكيلو المفتوح أو خدمة تغير السيارة في أي وقت. على سبيل المثال، يمكنك قيادة سيارة سيدان خلال الأسبوع والتحول إلى سيارة رياضية أو سيارة دفع رباعي لقضاء رحلة نهاية الأسبوع مع الأهل والأصدقاء.'),
