(116, 'page_meta_keywords_vertex_1563736946', '_vertex_1563736946', 'english', 'branches'),
(117, 'faq_question_vertex_1564383138', '_vertex_1564383138', 'arabic', 'ما هي إفاد؟'),
(118, 'faq_answer_vertex_1564383138', '_vertex_1564383138', 'arabic', '<p>إفاد هي منصة إلكترونية لتقدم نموذج بديل للنماذج التقليدية الموجودة في الوقت الحالي للحصول على سيارة. لذلك تقدم إفاد لعملائها خدمة الاشتراك للسيارات والتي من خلالها تستطيع/ي استخدام سيارتك مقابل رسوم اشتراك ثابتة لمدة (أسبوع/ شهر/ سنة). تغطي رسوم الاشتراك خدمة التأمين الشامل وخدمة المساعدة على الطريق وخدمة الصيانة الدورية وخدمة التوصيل والاستلام وخدمة الكيلو المفتوح أو خدمة تغير السيارة في أي وقت. على سبيل المثال، يمكنك قيادة سيارة سيدان خلال الأسبوع والتحول إلى سيارة رياضية أو سيارة دفع رباعي لقضاء رحلة نهاية الأسبوع مع الأهل والأصدقاء.</p>\r\n'),
