(274, 'faq_answer_vertex_1564403447', '_vertex_1564403447', 'arabic', 'نعم، تستطيع دفع قيمة اشتراك العضوية نقداً (كاش)، ولكن هناك رسوم إضافية على خدمة الدفع النقدي وقدرها 100 ريال.'),
