(474, 'faq_answer_vertex_1564408086', '_vertex_1564408086', 'arabic', 'سيقوم فريق العناية بالعملاء بالتواصل معك وتسليمك سيارة بديل في أقرب وقت ممكن حتى يتم الانتهاء من إصلاح سيارتك أو إستكمال الإجراءات اللازمة.'),
